import React from 'react'
import 'antd/dist/antd.css';
import { Layout } from 'antd';
import Sidebar from '../components/Sider/Sidebar';
// import Sidebar from '../components/Sider/Sidebar';
import { UserOutlined } from '@ant-design/icons';

export default function MainLayout(props) {
    const { Header, Content, Footer, Sider } = Layout;
    return (
        <Layout>
            <Header className="site-layout-sub-header-background" style={{ padding: '0 25 0 0 ', color: "white", textAlign: 'right' }}>
                <div></div>
            </Header>
            <Layout>
                <Sider>
                    <Sidebar role='ad' />
                </Sider>
                <Content style={{ margin: '24px 16px 0' }}>
                    <div className="site-layout-background" style={{ padding: 24, minHeight: 360, background: "white" }}>
                        {props.children}
                    </div>
                </Content>
            </Layout>
            <Layout>
                <Footer style={{ textAlign: 'center' }}>Devices manage 2021 @Vo Nguyen Thinh</Footer>
            </Layout>
        </Layout>
    )
}
